import React, { Component } from 'react';
import {Button, ButtonGroup} from 'react-bootstrap';




class Kayitlogo extends Component {
    render() {
        return (
            <div className='kitapkayit'>
             <ButtonGroup aria-label="Basic example">
  <Button variant="primary" href="/kitapkayit"><span>Kitap Ekle </span></Button>
  <Button variant="secondary" href="/kitapkayit"><span>Kitap Ekle </span></Button>

</ButtonGroup>
     
            </div>
        )
    }
}
export default Kayitlogo;
